import axios from "axios";
// get all no.of clients
const API_PATH =
  "https://us-central1-gatestone-yyte.cloudfunctions.net/campaignAnalytics";
export function getCampaignAnalytics(data) {
  return Promise((resolve, reject) => {
    axios
      .post(API_PATH, data)
      .then((response) => {
        resolve(response);
      })
      .catch((err) => {
        reject(err);
      });
  });
}
